export const setRegister = (cb, form) => {
    const {confirmPassword, ...oldForm} = form;
    const newForm = {...oldForm, password2: confirmPassword, phone_number : ''};
    console.log('Old form: ', form);
    console.log('New form: ', newForm);
    cb(newForm);
};
